// "SPDX-License-Identifier: UNLICENSED"
pragma solidity ^0.8.4;
pragma abicoder v2;
// allow special functions to only be done by the owner
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract LeagueMaker is ReentrancyGuard, Ownable {

    using SafeMath for uint256;
    event editLeagueEvent(uint256 _leagueId, string _gameName, uint256 _liveTime, uint256 _closeTime, uint256 _maxPlayer, string[] _winConds, string[] _winCondOps);
    event leagueIsWaitingEvent(uint256 _leagueId, string _gameName, uint256 _openTime, uint256 _liveTime, uint256 _closeTime, uint256 _minEntry, address _byAdmin, uint256 _initReward, uint256 _maxPlayer, string[] _winConds, string[] _winCondOps);
    event leagueIsPlayingEvent(uint256 _leagueId, uint256 _time, address _byAdmin);
    event leagueIsDoneEvent(uint256 _leagueId, uint256 _time, string[] _winners, uint256 _prizePerParticipant, address _byAdmin);
    event leagueIsCancelledEvent(uint256 _leagueId, uint256 _time, address _byAdmin);

    event leagueJoined(uint256 _leagueId, uint256 _time, address _pAddress, string _nickName, bool isBlocked, uint256 _uniqueIdCnt);
    event prizeClaimed(uint256 _leagueId, uint256 _time, address _pAddress, string _nickName, uint256 _amount);
    event blockPlayerEvent(uint256 _leagueId, string _name);
    event unblockPlayerEvent(uint256 _leagueId, string _name);
    event unBlockUsersEvent(address[] _userAddrs);
    event blockUsersEvent(address[] _userAddrs);
    event withdrawAsAdminEvent(uint256 _time, address _from, address _to, uint256 _amount, string _message);
    event createUserEvent(address _userAddr, uint256 _state, string _name, uint256 _time);
    event updateUserEvent(address _userAddr, uint256 _state, string _name, bool _blockState);
    event updateContractBalanceEvent(uint256 _amount, uint256 _time);
    event kickPlayersEvent(uint256 _leagueId, string[] _names);
    event setAdminStateEvent(address userAddr, uint256 state, string _name, uint256 _time);

    uint256 public lastLeagueId; // Keeps track of how many leagues we have served


    uint256 private contractBalance = 0;

    enum Status {
        Open,
        Live,
        Closed
    }

    struct League {
        uint256 leagueId;
        Status status;
        uint256 openTime;
        uint256 liveTime;
        uint256 closeTime;
        uint256 minEntry; // minimum fee in wei
        uint256 totalPrize;
        uint256 prizePerPlayer;
        address manager;
        bool exists;
        // new fields for 20/06
        uint256 maxPlayer; // maximum number of players
        uint256 playersJoined;
        uint256 uniqueIdCnt;
    }

    struct Participant {
        address pAddress; // this will tell you which user this participant belongs to
        string nickName;
        bool exists;
        bool isWinner;
    }

    struct User {
        bool exists;
        bool isBlocked;
        uint256 adminLevel;
    }

    mapping(uint256 => League) private _leagues;
    mapping(uint256 => mapping(address => string)) private _addressToString;
    mapping(address => User) private _addressToUser; 
    mapping(uint256 => address[]) private _participantList;
    mapping(uint256 => mapping(string => Participant)) private  _leagueParticipants;

    mapping(uint256 => mapping(address => uint256)) private _prizes;
    
    // lv1: Stage League
    // lv2: Stage League + reward, lv3: Stage League + Reward + Manager
    // Only level 3 can set who is admin!!! (lv3 should also be the owner of the contract)

    constructor(){
        _addressToUser[msg.sender].adminLevel = 3;
        _addressToUser[msg.sender].exists = true;
        emit setAdminStateEvent(msg.sender, 3, "EDDY", block.timestamp);
        // setAdminState(msg.sender, 3, "Eddy");
        lastLeagueId = 0;
    }

    modifier leagueExist(uint256 leagueId) {
        require(_leagues[leagueId].exists == true, "league does't exist");
        _;
    }

    modifier leagueActionControl(uint256 leagueId) { // admin whose level > lv can access control 
        if (_leagues[leagueId].manager != msg.sender && _addressToUser[msg.sender].adminLevel != 3){
            revert("You can't perform this action");
        }
        // require(_addressToUser[msg.sender].adminLevel > lv || );
        _;
    }

    modifier adminAtLeast(uint256 lv) {
        require(_addressToUser[msg.sender].adminLevel >= lv);
        _;
    }

    function getContractBalance() adminAtLeast(3) public view returns(uint256) {
        return contractBalance;
    }

    function updateContractBalance(uint256 amount) private {
        contractBalance = amount;
        emit updateContractBalanceEvent(amount, block.timestamp);
    }

    function setAdminState(address userAddr, uint256 state, string memory name) public adminAtLeast(2) {
        require(userAddr != msg.sender, "You are trying to change your own admin state");
        _addressToUser[userAddr].adminLevel = state;
        _addressToUser[userAddr].exists = true;
        emit setAdminStateEvent(userAddr, state, name, block.timestamp);
    }

    function blockUsers(address[] memory userAddrs) public adminAtLeast(3) {
        for(uint i = 0; i < userAddrs.length; ++i) {
            _addressToUser[userAddrs[i]].isBlocked = true;
        }
        emit blockUsersEvent(userAddrs);
    }

    function unBlockUsers(address[] memory userAddrs) public adminAtLeast(3) {
        for(uint i = 0; i < userAddrs.length; ++i) {
            _addressToUser[userAddrs[i]].isBlocked = false;
        }
        emit unBlockUsersEvent(userAddrs);
    }

    function blockPlayers(uint256 leagueId, string[] memory players) public 
    leagueExist(leagueId) leagueActionControl(leagueId) {
        for(uint i = 0; i < players.length; i++) {
            require(_leagueParticipants[leagueId][players[i]].exists == true, "player doesn't exist");
            _addressToUser[_leagueParticipants[leagueId][players[i]].pAddress].isBlocked = true;
            emit blockPlayerEvent(leagueId, players[i]);
        }
    }

    function unblockPlayers(uint256 leagueId, string[] memory players) public 
    leagueExist(leagueId) leagueActionControl(leagueId) {
        for(uint i = 0; i < players.length; i++) {
            require(_leagueParticipants[leagueId][players[i]].exists == true, "player doesn't exist");
            _addressToUser[_leagueParticipants[leagueId][players[i]].pAddress].isBlocked = false;
            emit unblockPlayerEvent(leagueId, players[i]);
        }
    }

    function kickPlayers(uint256 leagueId, string[] memory players) public 
    leagueExist(leagueId) leagueActionControl(leagueId) {
        for(uint i = 0; i < players.length; i++) {
            address playerAddress = _leagueParticipants[leagueId][players[i]].pAddress;
            require(_leagueParticipants[leagueId][players[i]].exists == true, "player doesn't exist");
            delete _leagueParticipants[leagueId][players[i]];
            delete _addressToString[leagueId][playerAddress];

            _leagues[leagueId].playersJoined--;
        }
        emit kickPlayersEvent(leagueId, players);
    }

    function editLeague(
        uint256 leagueId,
        string memory gameName,
        uint256 liveTime, // the time the league is live
        uint256 closeTime, // the time to close the league
        uint256 maxPlayer, // maximum number of players
        string[] memory winConds,
        string[] memory winCondOps
    ) public leagueActionControl(leagueId) leagueExist(leagueId) {
        require(_leagues[leagueId].status == Status.Open, "Can only edit waiting league");
        require(winConds.length == winCondOps.length + 1, "len(winConds) != len(winCondOps)+1");
        require(liveTime >= 0, "liveTime must >= 0");
        require(closeTime >= liveTime, "closeTime must >= liveTime");
        require(maxPlayer >= 0, "maxPlayer must >= 0");
        require(maxPlayer >= _leagues[leagueId].playersJoined, "maxPlayer must >= number of joined players");
        _leagues[leagueId].liveTime = liveTime;
        _leagues[leagueId].closeTime = closeTime;
        _leagues[leagueId].maxPlayer = maxPlayer;
        emit editLeagueEvent(leagueId, gameName, liveTime, closeTime, maxPlayer, winConds, winCondOps);
    }

    function makeWaitingLeague(
        string memory gameName,
        uint256 minEntry, //minimum price for entry
        uint256 liveTime, // the time the league is live
        uint256 closeTime, // the time to close the league
        uint256 maxPlayer, // maximum number of players
        uint256 initReward, // master can provide some money as reward too
        string[] memory winConds,
        string[] memory winCondOps
        ) public payable adminAtLeast(1) // only admins can create leagues 
        {
            require(winConds.length == winCondOps.length + 1, "len(winConds) != len(winCondOps)+1");
            require(msg.value == initReward, "initReward != msg.value");
            require(minEntry >= 0, "minEntry must >= 0");
            require(liveTime >= 0, "liveTime must >= 0");
            require(closeTime >= liveTime, "closeTime must >= liveTime");
            require(maxPlayer >= 0, "maxPlayer must >= 0");
            lastLeagueId++;
            _leagues[lastLeagueId] = League({
                leagueId: lastLeagueId,
                status: Status.Open,
                openTime: block.timestamp, // set the creation time to now
                liveTime: liveTime, // set the live time
                closeTime: closeTime, // set the close time
                minEntry: minEntry,
                totalPrize: initReward,
                prizePerPlayer: 0,
                manager: msg.sender,
                exists: true,
                maxPlayer: maxPlayer,
                playersJoined: 0,
                uniqueIdCnt: 0
            });
            emit leagueIsWaitingEvent(lastLeagueId, gameName, block.timestamp, liveTime, closeTime, minEntry, msg.sender, initReward, maxPlayer, winConds, winCondOps);
        }

    // If you join 5 times (after being kicked), you can get repaid 5 times. Can't make it better now:(
    function makeCancelledLeague(uint256 leagueId) external leagueActionControl(leagueId) leagueExist(leagueId) {
        for (uint i = 0; i < _participantList[leagueId].length; i++){
            payable(_participantList[leagueId][i]).transfer(_leagues[leagueId].minEntry);
        }
        delete _participantList[leagueId];
        delete _leagues[leagueId];
        emit leagueIsCancelledEvent(leagueId, block.timestamp, msg.sender);
    }

    
    // nonReentrant makes sure you only enter league once
    function joinLeague(uint256 leagueId, string memory nickName) external 
    nonReentrant leagueExist(leagueId) payable{
        require(_leagues[leagueId].maxPlayer > _leagues[leagueId].playersJoined, "league Full");
        require(_leagueParticipants[leagueId][nickName].exists==false, "Nickname taken");
        // require(_addressToUser[_leagueParticipants[leagueId][nickName].pAddress].isBlocked==false, "this player is blocked from joining things");
        require(_leagueParticipants[leagueId][_addressToString[leagueId][msg.sender]].exists==false, "Address've registered");
        require(_addressToUser[msg.sender].isBlocked==false, "Acc blocked from joining things");
        //can only join if value is bigger than minimum entry
        require(msg.value == _leagues[leagueId].minEntry, "Provide the exact value of minimum entry requirement (wei)");
        
        //can only join if league is open;
        require(_leagues[leagueId].status == Status.Open, "This league is not open");
        require(_leagues[leagueId].manager != msg.sender, "manager who made league can't join");
        
        // add address to participant list
        _participantList[leagueId].push(msg.sender);
        _leagues[leagueId].playersJoined++;
        _leagues[leagueId].uniqueIdCnt++;
        _addressToString[leagueId][msg.sender] = nickName; 
        // add the participant to the league
        _leagueParticipants[leagueId][nickName] = Participant({
            pAddress: msg.sender,
            nickName: nickName,
            exists: true,
            isWinner: false
        });

        // add the prize to the total rewards
        _leagues[leagueId].totalPrize = _leagues[leagueId].totalPrize.add(msg.value.mul(90).div(100));
        updateContractBalance(contractBalance.add(msg.value.mul(90).div(100)));

        emit leagueJoined(leagueId, block.timestamp, msg.sender, nickName, false, _leagues[leagueId].uniqueIdCnt);
    }

    function withdrawAsAdmin(address to, uint256  amount, string memory message) external adminAtLeast(3){
        require(amount < contractBalance,"insufficient fund");
        payable(to).transfer(amount);
        updateContractBalance(contractBalance - amount);
        emit withdrawAsAdminEvent(block.timestamp, msg.sender, to, amount, message);
    }

    // onlyOwner can start a league
    function makePlayingLeague(uint256 leagueId) external leagueActionControl(leagueId) leagueExist(leagueId) {
        // the status must be created to start it
        require(_leagues[leagueId].status == Status.Open, "Must create League 1st");
        _leagues[leagueId].status = Status.Live;

        emit leagueIsPlayingEvent(leagueId, block.timestamp, msg.sender);
    }

    // onlyOwner can close a league
    function makeDoneLeague(uint256 leagueId, string[] memory winners) 
        external leagueActionControl(leagueId) leagueExist(leagueId) {
        // status must be live
        require(_leagues[leagueId].status == Status.Live, "Must be [Live] to close");
        // check if winners are legit in the league
        for(uint i = 0; i < winners.length; i++){
            require(_leagueParticipants[leagueId][winners[i]].exists==true, "player not in league");
        }
        uint256 totalMoney = _leagues[leagueId].totalPrize; // total money associated with league
        uint256 totalPrize = totalMoney.mul(80).div(100); // 80% is the total prize allocated to players
        uint256 prizePerPlayer = totalPrize.div(winners.length); // prize per player
        uint256 leftovers = totalPrize.sub(prizePerPlayer.mul(winners.length)); 
        // allocate prize to each player
        for (uint256 index = 0; index < winners.length; index++) {
            require(_addressToUser[_leagueParticipants[leagueId][winners[index]].pAddress].isBlocked == false, "blocked player NO winner");
            _prizes[leagueId][_leagueParticipants[leagueId][winners[index]].pAddress] = prizePerPlayer;
        }
        uint256 ten_percent = leftovers.mul(50).div(100); // 50% of what's left is 10%
        payable(_leagues[leagueId].manager).transfer(ten_percent); // 10% is sent to the manager
        delete _leagues[leagueId];
        emit leagueIsDoneEvent(leagueId, block.timestamp, winners, prizePerPlayer, msg.sender);
    }

    function withdrawRewards(uint256[] memory leagueId) external {
        require(_addressToUser[msg.sender].isBlocked == false, "playar is blocked");
        uint256 sumMoney = 0;
        for(uint256 i = 0; i < leagueId.length; i++){
            string memory nickName = _addressToString[leagueId[i]][msg.sender];
            uint256 prize = _prizes[leagueId[i]][msg.sender];
            //require(prize > 0, "No rewards are associated with this league id");
            sumMoney += _leagues[leagueId[i]].prizePerPlayer;
            emit prizeClaimed(leagueId[i], block.timestamp, msg.sender, nickName, prize);
            delete _prizes[leagueId[i]][msg.sender];
        }
         // send all money to the winner
        payable(msg.sender).transfer(sumMoney);
    }

}

